import React from "react";
import logo from "./logo.svg";
import "./App.css";

import { Disclosure, Menu, Transition } from "@headlessui/react";

function App() {
    function classNames(...classes: any[]) {
        return classes.filter(Boolean).join(" ");
    }

    const userNavigation = [
        { name: "Your Profile", href: "#" },
        { name: "Settings", href: "#" },
        { name: "Sign out", href: "#" },
    ];

    return (
        <div className="">
            <div
                id="name"
                className="h-20 border-b-2 w-full font-bold text-2xl font-mono flex items-center justify-center"
            >
                <p className="font-bold text-3xl text-center text-transparent bg-clip-text bg-gradient-to-r from-blue-500 to-pink-600">
                    thoughtfulkoala666
                </p>
                <div id="nav-items">
                    {/* Profile dropdown */}
                    <Menu as="div" className="relative ml-4 flex-shrink-0">
                        <div>
                            <Menu.Button className="flex rounded-full bg-white focus:outline-none focus:ring-2 focus:ring-indigo-500 focus:ring-offset-2">
                                <span className="sr-only">Open user menu</span>
                                <img
                                    className="h-8 w-8 rounded-full"
                                    src={user.imageUrl}
                                    alt=""
                                />
                            </Menu.Button>
                        </div>
                        <Transition
                            as={Fragment}
                            enter="transition ease-out duration-100"
                            enterFrom="transform opacity-0 scale-95"
                            enterTo="transform opacity-100 scale-100"
                            leave="transition ease-in duration-75"
                            leaveFrom="transform opacity-100 scale-100"
                            leaveTo="transform opacity-0 scale-95"
                        >
                            <Menu.Items className="absolute right-0 z-10 mt-2 w-48 origin-top-right rounded-md bg-white py-1 shadow-lg ring-1 ring-black ring-opacity-5 focus:outline-none">
                                {userNavigation.map((item) => (
                                    <Menu.Item key={item.name}>
                                        {({ active }) => (
                                            <a
                                                href={item.href}
                                                className={classNames(
                                                    active ? "bg-gray-100" : "",
                                                    "block py-2 px-4 text-sm text-gray-700"
                                                )}
                                            >
                                                {item.name}
                                            </a>
                                        )}
                                    </Menu.Item>
                                ))}
                            </Menu.Items>
                        </Transition>
                    </Menu>
                </div>
            </div>
        </div>
    );
}

export default App;
